package ra.dev.model.dto;public class OrdersDTO {    private Integer orderId;    private String address;    private java.sql.Timestamp date;    private String email;    private String fullName;    private String note;    private Boolean orderStatus;    private Integer phoneNumber;    private Integer totalAmount;    private Integer userId;    public Integer getOrderId() {        return this.orderId;    }    public void setOrderId(Integer orderId) {        this.orderId = orderId;    }    public String getAddress() {        return this.address;    }    public void setAddress(String address) {        this.address = address;    }    public java.sql.Timestamp getDate() {        return this.date;    }    public void setDate(java.sql.Timestamp date) {        this.date = date;    }    public String getEmail() {        return this.email;    }    public void setEmail(String email) {        this.email = email;    }    public String getFullName() {        return this.fullName;    }    public void setFullName(String fullName) {        this.fullName = fullName;    }    public String getNote() {        return this.note;    }    public void setNote(String note) {        this.note = note;    }    public Boolean getOrderStatus() {        return this.orderStatus;    }    public void setOrderStatus(Boolean orderStatus) {        this.orderStatus = orderStatus;    }    public Integer getPhoneNumber() {        return this.phoneNumber;    }    public void setPhoneNumber(Integer phoneNumber) {        this.phoneNumber = phoneNumber;    }    public Integer getTotalAmount() {        return this.totalAmount;    }    public void setTotalAmount(Integer totalAmount) {        this.totalAmount = totalAmount;    }    public Integer getUserId() {        return this.userId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }}